BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "bookings" (
	"id"	INTEGER,
	"customerMobile"	TEXT,
	"providerMobile"	TEXT,
	"status"	TEXT DEFAULT 'pending',
	"createdAt"	DATETIME DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "customers" (
	"id"	INTEGER,
	"mobileNumber"	TEXT UNIQUE,
	"name"	TEXT,
	"role"	TEXT DEFAULT 'customer',
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "providers" (
	"latitude"	REAL,
	"longitude"	REAL,
	"name"	TEXT,
	"gender"	TEXT,
	"age"	INTEGER,
	"skills"	TEXT,
	"mobileNumber"	TEXT,
	"location"	TEXT,
	"taluk"	TEXT,
	"district"	TEXT,
	"state"	TEXT,
	"role"	provider
);
CREATE TABLE IF NOT EXISTS "reviews" (
	"id"	INTEGER,
	"bookingId"	INTEGER,
	"customerMobile"	TEXT,
	"providerMobile"	TEXT,
	"rating"	INTEGER,
	"comment"	TEXT,
	"createdAt"	DATETIME DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
